import React, { Component } from 'react';
import { Button } from 'reactstrap';
import { Container } from './styles';

export default class Projects extends Component {
  render() {
    return (
    <Container>
      <Button 
        color='primary'
        size='lg'
      >
        New
      </Button>
      <Button 
        color='warning'
        size='lg'
      >
        Edit
      </Button>
      <Button
        color='danger'
        size='lg'
      >
        Delete
      </Button>
    </Container>);
  }
}
